import{_ as e,c as d,a2 as a,o as r}from"./chunks/framework.BQmytedh.js";const m=JSON.parse('{"title":"MIME类型 --笔记","description":"","frontmatter":{},"headers":[],"relativePath":"数据库/常识/MIME.md","filePath":"数据库/常识/MIME.md","lastUpdated":null}'),o={name:"数据库/常识/MIME.md"};function i(p,t,l,s,h,n){return r(),d("div",null,t[0]||(t[0]=[a('<h1 id="mime类型-笔记" tabindex="-1">MIME类型 --笔记 <a class="header-anchor" href="#mime类型-笔记" aria-label="Permalink to &quot;MIME类型 --笔记&quot;">​</a></h1><h2 id="一、mime-type" tabindex="-1">一、MIME type <a class="header-anchor" href="#一、mime-type" aria-label="Permalink to &quot;一、MIME type&quot;">​</a></h2><h3 id="_1-1-概念" tabindex="-1">1.1 概念 <a class="header-anchor" href="#_1-1-概念" aria-label="Permalink to &quot;1.1 概念&quot;">​</a></h3><ul><li>MIME（Multipurpose Internet Mail Extensions）多用途互联网邮件扩展类型</li><li>一种标准，用来表示文档、文件或一组数据的性质和格式</li></ul><h3 id="_1-2-结构" tabindex="-1">1.2 结构 <a class="header-anchor" href="#_1-2-结构" aria-label="Permalink to &quot;1.2 结构&quot;">​</a></h3><p>两个部分：<em>类型</em>（type）和<em>子类型</em>（subtype），中间由斜杠 <code>/</code> 分割，中间没有空白字符：</p><div class="language-shell vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">shell</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">type/subtype</span></span></code></pre></div><p>**类型**代表数据类型所属的大致分类，例如 <code>video</code> 或 <code>text</code>。</p><p>**子类型**标识了 MIME 类型所代表的指定类型的确切数据类型。以 <code>text</code> 类型为例，它的子类型包括：<code>plain</code>（纯文本）、<code>html</code>（<a href="https://developer.mozilla.org/zh-CN/docs/Glossary/HTML" target="_blank" rel="noreferrer">HTML</a> 源代码）、<code>calender</code>（iCalendar/<code>.ics</code> 文件）。</p><p>每种类型都有自己的一组可能的子类型。一个 MIME 类型总是包含类型与子类型这两部分，且二者必需成对出现。</p><p>有一个可选的<strong>参数</strong>，能够提供额外的信息：</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>type/subtype;parameter=value</span></span></code></pre></div><p>例如，对于主类型为 <code>text</code> 的任何 MIME 类型，可以添加可选的 <code>charset</code> 参数，以指定数据中的字符所使用的字符集。如果没有指定 <code>charset</code>，默认值为 <a href="https://developer.mozilla.org/zh-CN/docs/Glossary/ASCII" target="_blank" rel="noreferrer">ASCII</a>（<code>US-ASCII</code>），除非被<a href="https://developer.mozilla.org/zh-CN/docs/Glossary/User_agent" target="_blank" rel="noreferrer">用户代理的</a>设置覆盖。要指定 UTF-8 文本文件，则使用 MIME 类型 <code>text/plain;charset=UTF-8</code>。</p><p>MIME 类型对大小写不敏感，但是传统写法都是小写。参数值可以是大小写敏感的。</p><h2 id="二、常见的mime-type" tabindex="-1">二、常见的MIME type <a class="header-anchor" href="#二、常见的mime-type" aria-label="Permalink to &quot;二、常见的MIME type&quot;">​</a></h2><p>文本</p><table tabindex="0"><thead><tr><th>MIME types</th><th>说明</th></tr></thead><tbody><tr><td>text/plain</td><td>普通文本, 默认值</td></tr><tr><td>text/csv</td><td>csv 文件</td></tr><tr><td>text/css</td><td>css 文件</td></tr><tr><td>text/html</td><td>html 文件</td></tr><tr><td>text/javascript</td><td>JavaScript 文件</td></tr><tr><td>text/xml</td><td>xml 文件 (可读)</td></tr><tr><td>application/xml</td><td>xml 文件 (不可读)</td></tr><tr><td>application/rtf</td><td>富文本</td></tr><tr><td>application/pdf</td><td>pdf 文件</td></tr><tr><td>application/json</td><td>json 文件</td></tr></tbody></table><p>图片</p><table tabindex="0"><thead><tr><th>MIME types</th><th>说明</th></tr></thead><tbody><tr><td>image/gif</td><td>gif 图片</td></tr><tr><td>image/jpeg</td><td>jpeg 图片</td></tr><tr><td>image/png</td><td>png 图片</td></tr><tr><td>image/svg+xml</td><td>svg 图片</td></tr><tr><td>image/webp</td><td>web 图片</td></tr><tr><td>image/tiff</td><td>tiff 图片</td></tr><tr><td>image/x-icon</td><td>ico 图标</td></tr></tbody></table><p>音视频</p><table tabindex="0"><thead><tr><th>MIME types</th><th>说明</th></tr></thead><tbody><tr><td>audio/acc</td><td>acc 音频</td></tr><tr><td>audio/mp3</td><td>mp3 音频</td></tr><tr><td>audio/wav</td><td>wav 音频</td></tr><tr><td>audio/webm</td><td>webm 音频</td></tr><tr><td>video/webm</td><td>webm 视频</td></tr></tbody></table><p>表单</p><table tabindex="0"><thead><tr><th>MIME types</th><th>说明</th></tr></thead><tbody><tr><td>multipart/form-data</td><td>表单</td></tr></tbody></table><p>字体</p><table tabindex="0"><thead><tr><th>MIME types</th><th>说明</th></tr></thead><tbody><tr><td>font/otf</td><td>otf 格式</td></tr><tr><td>font/ttf</td><td>ttf 格式</td></tr><tr><td>font/woff</td><td>woff 格式</td></tr><tr><td>font/woff2</td><td>woff2 格式</td></tr></tbody></table><p>压缩包</p><table tabindex="0"><thead><tr><th>MIME types</th><th>说明</th></tr></thead><tbody><tr><td>application/zip</td><td>zip 格式</td></tr></tbody></table><p><a href="https://www.iana.org/assignments/media-types/media-types.xhtml" target="_blank" rel="noreferrer">MIME 类型大全</a></p>',28)]))}const b=e(o,[["render",i]]);export{m as __pageData,b as default};
